let div = document.querySelector('div');
// let img = document.querySelector('img');

fruit.map(fruits=>{
    console.log(fruits.name)
    let nama = document.createTextNode('Nama Buah: ' + fruits.name);
    let p = document.createElement('p');
    p.appendChild(nama)
    div.appendChild(p)

    let namaLatin = document.createTextNode('Nama Latin: ' + fruits.latin);
    let p1 = document.createElement('p');
    p1.appendChild(namaLatin)
    div.appendChild(p1)
    console.log(fruits.image)

    let image = fruits.image;
    let img = document.createElement('img');
    img.setAttribute('src', image)
    div.appendChild(img)
})